import{GithubApi}from"./api.min.js";export async function projectsList(){const container=document.querySelector("#project-list"),github=new GithubApi,githubData=await github.repos();githubData.map(data=>{if(data.homepage){const project=document.createElement("div");project.innerHTML=`\n                <h3>${data.name}</h3>\n                <p>${data.description}</p>\n                <div class="link-container">\n                    <a href="${data.homepage}">Visualizar projeto</a>\n                    <a href="${data.html_url}">Repositorio</a>\n                </div>\n            `,project.classList.add("project-box"),container.appendChild(project)}})}